import React, { Component } from "react";
import { Container, Row, Col, Image, CardGroup, CardImg } from "react-bootstrap";
import Card from "react-bootstrap/Card";
import {Link} from "react-router-dom";

class Home extends Component {
  render() {
    return (
      <div className="home">
        <Container>
          <Row>
            <Card className="card">
                <Card.Text>
                  Current car
                </Card.Text>
              <Card.Img
                variant="top"
                src=".\img\580b585b2edbce24c47b2cc6.png"
              />
              <Card.Body>
                <Card.Text>
                  Car brand : Suzuki 
                  <br/>
                  Kilometers: 500.000
                </Card.Text>
              </Card.Body>
            </Card>
          </Row>
          <Row className="buttonrow">
            <button className="button"> Force switch car </button>
          </Row>
          <Row >
            <Link to="./notifications" className="button"> <Row> <Col>Notifications</Col> <Col>0</Col></Row> </Link>
            
          </Row>
        </Container>
      </div>
    );
  }
}

export default Home;
